var tipuesearch = {"pages": [{'title': 'Week', 'text': '', 'tags': '', 'url': 'Week.html'}, {'title': 'Week2-5', 'text': 'Week 2 建立新的github倉儲 \n 1.到個人網站建立新的倉儲，並且clone到近端(要去mde.tw下載"2019fall可攜套件")。 \n 2.用git config --global user設定名稱、信箱和proxy，之後再用指令git submodule add 建立目錄取下子模型。 \n 3.最後再輸入python -m pip install flask cors即可。 \n 4.備註:要進入近端，必須先進入cmsimde，指令python wsgi.py方能使用。 \n \n \n Week3 Solvespace編譯 \n 1.Y:\\portablegit\\bin\\sh.exe 改名為 sh_rename_for_solvespace.exe。 \n 2.更新github版本到2.13以上。 \n 3.git clone --recurse-submodules https://github.com/solvespace/solvespace.git solvespace \n 4.編輯cmakelist，在713~714行之間加入#字號。 \n 5.把ibpng.dll.a 的編譯, 並改名為 libpng_static.a, 並放到編譯系統的 lib 目錄中。 \n 6.切路徑至build，再執行cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release，輸入mingw32-make。 \n 7.路徑切回solvespace原始碼，建立並進入Build目錄，再次執行cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release，輸入mingw32-make。 \n \n Week4 自行更新網站，拍攝影片及嵌字幕的軟體 \n 1.影片: Share-X \n \n 2.字幕: Aegisub \n \n 3.整合影片和字幕: Arctime \n 註:影片需有課程或自己的浮水印 \n Week5 solvespace圖面繪製練習 \n 到http://mde.tw/cad2019/content/Solvespace%20%E6%93%8D%E4%BD%9C.html \n 選擇一個去畫，切記要與小組組員畫不同的。 \n \n 快捷鍵 \n (D)標註尺寸 \n (Q)相同 \n (H)水平共線 \n (V)垂直共線 \n (Shift+X)延伸 \n (M)線中心點 \n', 'tags': '', 'url': 'Week2-5.html'}, {'title': 'Week6-9', 'text': '', 'tags': '', 'url': 'Week6-9.html'}, {'title': 'Week10-14', 'text': '', 'tags': '', 'url': 'Week10-14.html'}, {'title': 'Week15-18', 'text': '', 'tags': '', 'url': 'Week15-18.html'}]};